import React from 'react';
import {BrowserRouter,Routes, Route} from "react-router-dom";
import './App.css';
import Header from "./Component/Header/Header";
import Navbar from "./Component/Navbar/Navbar";
import Profile from "./Component/Profile/Profile";
import Dialogs from "./Component/Dialogs/Dialogs";
import News from "./Component/News/News";
import Music from "./Component/Music/Music";
let TextData = [
    {id:1,text:'acascascascsac'},
    {id:2,text:'acascascascsac'},
    {id:3,text:'dvsvsdacascascascsac'},
    {id:4,text:'acascascascsac'}
]
let DialogData = [
    {id:1,name:'Mikee'},
    {id:2,name:'Denis'},
    {id:3,name:'Mikee'},
    {id:4,name:'Mikee'},
    {id:5,name:'Mikee'}
]
let PostData = [
    {id:1,text:'444444',like:22},
    {id:2,text:'acascascascsac',like:22},
    {id:3,text:'acascascascsac',like:22},
    {id:3,text:'acascascascsac',like:22},
    {id:3,text:'acascascascsac',like:22},
    {id:3,text:'acascascascsac',like:22},
    {id:4,text:'acascavdvdvdscascsac',like:22}
]
const App = (props) => {


    return (
        <BrowserRouter>
            <div className="wrapper">
                <Header/>
                <Navbar/>
                <div className={"contain"}>
                    <Routes>
                    <Route path='/profile' element={<Profile PostData={PostData}/>}/>
                    <Route path='/dialogs*'   element={<Dialogs DialogData={DialogData} TextData={TextData} />} />
                    <Route path='/news' element={<News/>}/>
                    <Route path='/music' element={<Music/>}/>
                    </Routes>
                </div>
            </div>
        </BrowserRouter>   );
}

export default App;
